int main ( ) { int T ; scanf ( "%d" , & T ) ; while ( T -- ) { long int n , i ; scanf ( "%ld" , & n ) ; long int A [ n ] ; for ( i = 0 ; i < n ; i ++ ) { scanf ( "%ld" , & A [ i ] ) ; } for ( i = 0 ; i < n ; i ++ ) { if ( A [ i ] > A [ i + 1 ] ) A [ i ] = 0 ; else if ( A [ i ] < A [ i + 1 ] ) A [ i + 1 ] = 0 ; } for ( i = 0 ; i < n ; i ++ ) { if ( A [ i ] != 0 ) printf ( "%ld\n" , A [ i ] ) ; } } return 0 ; }